package com.training.model;

public class User {

	private String id;
	private String name;
	
	public User() {
		// TODO Auto-generated constructor stub
		this.id = "0";
		this.name = "error";
	}

	public String getId() {
		return id;
	}

	public void setId(String id) {
		this.id = id;
	}

	public String getName() {
		return name;
	}

	public void setName(String name) {
		this.name = name;
	}
	
	
}
